import React, { Component } from 'react'

export class Logs extends Component {
    render() {
        return (
          <div>
              <h3>Login Activity</h3>
              Here is your last 10 login activities log
              <div className="container">
                <table>
                    <th>
                        <td>User Agent</td>
                        <td>IP</td>
                        <td>Time</td>
                    </th>
                </table>
              </div>
          </div>
        )
    }

}

export default  Logs;
